import React from "react";
import RobotsSection from "../components/layout/RobotsSection";
import axios from "axios";
import { useEffect, useState } from "react";
import { createRobots } from "../features/robots/RobotsReducer";

export default function Home() {
  const dispatch = useDispatch();

  useEffect(() => {
    axios.get("http://localhost:8000/api/robots").then(function (response) {
      let robots = response.map(response.data);
      dispatch(createRobots(robots));
    });
  });

  return (
    <div>
      <div className="container">
        <RobotsSection></RobotsSection>
      </div>
    </div>
  );
}
